import React, { Component } from 'react';
import inkstain from './inkstain.svg';
import Navigation from './Navigation';
import './Landing.css'
import { Container, Row, Col } from 'reactstrap';

class Landing extends Component {
  render() {
    return (
     <inkstain>
      <Navigation />
      <Row className="herotitle">
      <Col xs="6" className="heroleft">
      <Container>
      <h1 className="ebname"><span>Emily Bandel</span></h1>
      <h2 classname="ebtitle">Actress</h2>
      <button classname="explorebtn"><h3><span>Explore Contributions</span></h3></button>
      </Container>
      </Col>
      <Col xs="6"className="heroright">
      <Container>
      Image
      </Container>
      </Col>
      </Row> 
      <Row className="vancoiver">
      <Col xs="12"><span>Vancouver. BC</span></Col>
      </Row>    
     </inkstain>
    );
  }
}

export default Landing;
